import React, { Component } from 'react'

import ReactPlayer from 'react-player';

export default class YoutubeFooter extends Component {

    state = {
        playing : false
    }

    render() {
        var {title, author, url} = this.props
        return (
            <div style = {{
                height: 200, 
                width: '100%', 
                backgroundColor: 'white', 
                position: 'fixed', 
                bottom: 0,
                display: 'flex',
                flexDirection: 'row'}}>

                <ReactPlayer 
                    url={url}
                    width = {200}
                    height = {200}
                    playing = {this.state.playing}
                    onReady = {() => console.log("Ready")}/>

                <div>
                    <h5>{title}</h5>
                    <h6>{author}</h6>
                </div>

                <i style = {{fontSize: 100}} class="material-icons">play_arrow</i>
                <i style = {{fontSize: 50}} class="material-icons">fiber_manual_record</i>
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 941 15">
                <rect x="10" y="10" width="100" height="100" stroke="blue" fill="purple"
       fill-opacity="0.5" stroke-opacity="0.8"/>
                </svg>
            </div>
        )
    }
}
